import React from 'react'
function AddVideo() {
  return (

    class App extends React.Component {
      constructor(props) {
        super(props);
        this.state = {
          showInputs: false
        };
      }

      handleClick() {
        this.setState({
          showInputs: true
        });
      }}



)
}
export default AddVideo
